function final = create_nightingale()
    bird0 = load('Bird0.txt');
    [row,col] = size(bird0);
    b0 = [];
    s= 1;
    e= round(round(row/5))-1;
    for i = 1:5
        temp = [];
        temp = [temp bird0(s:e)];
        %c = zeros(40,1);
        %temp(2099+1:end,:)=[];
        %temp = vertcat(temp,c,NaN);
        temp = vertcat(temp,NaN);
        b0 = [b0 temp];
        s = e+1;
        e = e+round(round(row/5))-1;
    end
    
    bird1 = load('Bird1.txt');
    [row,col] = size(bird1);
    b1 = [];
    s= 1;
    e= round(round(row/5));
    for i = 1:5
        temp = [];
        temp = [temp bird1(s:e)];
        %c = zeros(318,1);
        %temp(2099+1:end,:)=[];
        %temp = vertcat(temp,c,NaN);
        temp = vertcat(temp,NaN);
        b1 = [b1 temp];
        s = e+1;
        e = e+round(round(row/5));
    end
    final = [b0 b1];
    
    fileID = fopen('bird_classification.txt','w'); %0-4 Class label 0 | 5-9 Class label 1
    fprintf(fileID,'%d\n',final);
    fclose(fileID);
end